function updatePriceTable(table, data) {
    table.update(
        {
            rows: data.map((price) => ({
                ...price,
                analytics: setAnalytics(price),
                title: `<div class="d-flex justify-content-end align-items-center flex-row-reverse"><div class="ms-3"><a class="mb-1">${price?.title}</a>
</div><img src="${price?.avatar || './img/big-camera.svg'}" alt="badge"
                style="width: 45px; height: 45px; background-color: var(--mark-color);" class="rounded-4"></div>`,
                quantity: `<span class="badge-price badge-${price?.quantity} rounded-pill">${price?.quantity}</span>`,
                section: setSector(price),
                actions: setCutActions(price?.id,`data-mdb-toggle="modal" data-mdb-target="#descriptionModal"`),
            })),
        },
        {loading: false},
    );
}


function fillInputsOfValues(itemOfId, title, price, description) {
    title.value = itemOfId?.title;
    price.value = itemOfId?.price;
    description.value = itemOfId?.description;

}

function getSelectInstance(itemOfId, select) {
    const selectInstance = mdb.Select.getInstance(select);
    selectInstance.setValue(itemOfId);
}



